<template>
  <div class="login-container">
    <el-form ref="loginForm" :model="loginForm" :rules="loginRules" class="login-form" auto-complete="on" label-position="left">
      <h3 class="title">茶饮后台管理系统</h3>
      <div class="kuang">
        <div class="welcomelogin"><span>——</span>欢迎登录<span>——</span></div>
        <el-form-item prop="username" style="width:90%;margin:auto;margin-bottom: 40px;">
          <span class="svg-container">
            <svg-icon icon-class="user" />
          </span>
          <el-input v-model="loginForm.username" name="username" type="text" placeholder="username" />
        </el-form-item>
        <el-form-item prop="password" style="width:90%;margin:auto;margin-bottom: 65px;">
          <span class="svg-container">
            <svg-icon icon-class="password" />
          </span>
          <el-input
            type="password"
            v-model="loginForm.password"
            name="password"
            placeholder="password"
            @keyup.enter.native="handleLogin" />
        </el-form-item>
        <el-form-item style="width:90%;margin:auto;">
          <el-button :loading="loading" style="width:100%;font-size:20px!important;background: linear-gradient(93deg, #1229B3 0%, #0057AF 100%)!important;color:white!important;" @click.native.prevent="handleLogin">
            登录
          </el-button>
        </el-form-item>
      </div>
    </el-form>
  </div>
</template>

<script>
import { isvalidUsername } from '@/utils/validate'
// import store from "../../store";
import { constantRouterMap } from "../../router";
import Cookies from 'js-cookie'

export default {
  name: 'Login',
  data() {
    const validateUsername = (rule, value, callback) => {
      if (!isvalidUsername(value)) {
        callback(new Error('请输入正确的用户名'))
      } else {
        callback()
      }
    }
    // const validatePass = (rule, value, callback) => {
    //   if (value.length < 6) {
    //     callback(new Error('密码不能小于6位'))
    //   } else {
    //     callback()
    //   }
    // }
    return {
      loginForm: {
        username: '',
        password: ''
      },
      loginRules: {
        username: [{ required: true, trigger: 'blur', validator: validateUsername }],
        password: [{ required: true, trigger: 'blur'}]
        // password: [{ required: true, trigger: 'blur', validator: validatePass }]
      },
      loading: false,
      pwdType: 'password',
      redirect: undefined
    }
  },
  watch: {
    $route: {
      handler: function(route) {
        this.redirect = route.query && route.query.redirect
      },
      immediate: true
    }
  },
  methods: {
    handleLogin() {
      this.$refs.loginForm.validate(valid => {
        if (valid) {
          // Cookies.set('username',this.loginForm.username)
          this.loading = true
          this.$store.dispatch('Login', this.loginForm).then(() => {
            this.loading = false
            this.$router.push({ path: this.redirect || '/' })
          }).catch(() => {
            this.loading = false
          })
        } else {
          return false
        }
      })
    }
  }
}
</script>

